create table user (
    id int(11) NOT NULL AUTO_INCREMENT,
    username varchar(255) NOT NULL COMMENT 'default auth being used by the user',
    firstname varchar(255) NOT NULL,
    lastname varchar(255) NOT NULL,
    email VARCHAR(255),
    gender VARCHAR(255),
    birth_date DATE,
    PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

